import React from 'react'
import { Line } from 'react-chartjs-2'

export default function LineChart({ labels, dataSet }) {
  const data = {
    labels,
    datasets: dataSet
  }

  return (
    <div>
      <Line data={data} width={400} height={100} />
    </div>
  )
}
